def draw_balance(data):

    # 创建图表
    plt.figure(figsize=(12, 7))

    sb = 0
    # 遍历每个标的的数据并绘制折线
    for label, values in data.items():
        # sb += 1
        # if sb < 3:
        #     continue
        timestamps = [datetime.fromtimestamp(int(ts) / 1000) for ts, _ in values]
        balances = [balance for _, balance in values]
        plt.plot(timestamps, balances, marker='o', linestyle='-', label=label, markersize=2)

    # 添加标题和标签
    # plt.title('各投资标的余额变化趋势', fontsize=16)
    plt.xlabel('time', fontsize=12)
    plt.ylabel('balance', fontsize=12)

    # 美化图表
    plt.grid(True, linestyle='--', alpha=0.6)
    plt.xticks(rotation=45)  # 旋转 x 轴标签以便更易阅读
    plt.legend(title='USDT', fontsize=10)  # 添加图例及标题

    # 显示图表
    plt.tight_layout()  # 自动调整布局以避免重叠
    plt.show()

if __name__ == '__main__':
    draw_balance(data)